import React, { Component } from "react";
import Pracs from './Prac';

class Header extends Component {
    render() {
        return (
            <div className="root">
                <div className="header-container">
                    <div className="title">
                        <i class="fas fa-radio"></i><p>ReactTracks</p>
                    </div>
                    <div className="dave">
                        <p>DAVE</p>
                    </div>
                    <div className="sign-out">
                        <p>SIGNOUT</p>
                    </div>
                </div>
                <div>
                    <hr/>
                </div>
                <div>
                    <Pracs/>
                </div>
            </div>
        )
    }
}

export default Header;
